Defendant Marzell D Fullilove in court with attorney John C. Glover.  Defendant Marzell D Fullilove in custody.  Megan Patricia Carmody appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by:  Rashiea G.  Sentencing proceeded.  Statements made by State, defense and defendant. 
 
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of  33 MONTHS, CONSECUTIVE to any other time being served with credit for 55 days. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 15 MONTHS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 18 MONTHS.
The defendant is eligible for the Challenge Incarceration Program; is not eligible for the Substance Abuse Program.  The Court STAYED this sentence and placed the defendant on probation for a period of 3 years with the following conditions.
CONDITIONS OF PROBATION:
*TOT to probation agent; 
*Obtain AODA assessment and complete follow-up care/treatment;
*Absolute sobriety with random urine screens and breathalyzer tests;
*No illegal drug dealing or association with drug community (drug users/dealers/houses);
*Cooperate with all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
* No contact with L. Cooper and/or residence, M. Brown and/or residence, R. Gales and/or residence;
*Obtain/maintain full time employment or full time school with part time employment;
*Obtain GED or HSED;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;
*Pay all applicable mandatory surcharges, fees, assessments, and costs by the end of probation period- any remaining balance to convert to civil judgment;
The Court set restitution at $0.  If revoked, the Court ordered all financial obligations and/or restitution to be paid through collection of sums by the Department of Corrections from 25% of prison funds and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.
Defendant is informed he may not possess and/or own any firearms.
Defendant is informed he may not vote in any election until his/her civil rights have been reinstated.  Appeal rights given. 
Defendant informed the Court that he will be living with his mother at 806 S. 76th Street and his current phone number is 414-231-1652.  
